values
    (1, 'Nutro Ultra Adult Dry Dog Food, 30 lbs', 18, 'food', 90, 'Ultra Adult Dry Dog Food is a nutrient dense, premium kibble, with all natural fruits and vegetables, such as blueberries, spinach and pomegranate. These premium ingredients provide high levels of antioxidants to give your dog a healthy heart, a strong immune system and a Shiny Coat. Like all Ultra Food for Dogs, it is made using only natural ingredients to support overall wellness, vitality and performance.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-adult-dry-dog-food-30-lbs/10090274-Ultra-dry-dog-front.jpg'),
    (2, 'Nutro Ultra Small Breed Adult Dry Dog Food, 4 lbs', 15, 'food', 26, 'Small dogs have big personalities, and they also have specific nutritional needs. Feed your small dog Ultra Small Breed Dry Dog Food, featuring an easy-to-chew kibble designed just for them. Your small breed dog will enjoy the unforgettable taste of premium ingredients, such as blueberries, cranberries and pomegranate in every bite, and you will enjoy the visible benefits from our super premium dog food blends.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-small-breed-adult-dry-dog-food-4-lbs/10090276-Ultra-dry-dog-front.jpg'),
    (3, 'Nutro Ultra Small Breed Adult Dry Dog Food, 8 lbs', 39, 'food', 37, 'Small dogs have big personalities, and they also have specific nutritional needs. Feed your small dog Ultra Small Breed Dry Dog Food, featuring an easy-to-chew kibble designed just for them. Your small breed dog will enjoy the unforgettable taste of premium ingredients, such as blueberries, cranberries and pomegranate in every bite, and you will enjoy the visible benefits from our super premium dog food blends.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-small-breed-adult-dry-dog-food-8-lbs/10090277-Ultra-dry-dog-front.jpg'),
    (4, 'Nutro Ultra Small Breed Adult Dry Dog Food, 15 lbs', 10, 'food', 72, 'Small dogs have big personalities, and they also have specific nutritional needs. Feed your small dog Ultra Small Breed Dry Dog Food, featuring an easy-to-chew kibble designed just for them. Your small breed dog will enjoy the unforgettable taste of premium ingredients, such as blueberries, cranberries and pomegranate in every bite, and you will enjoy the visible benefits from our super premium dog food blends.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-small-breed-adult-dry-dog-food-15-lbs/10090317-Ultra-dry-dog-front.jpg'),
    (5, 'Nutro Ultra Large Breed Adult Dry Dog Food, 15 lbs', 27, 'food', 80, 'Large breed dogs have specific nutritional needs. That''s why Ultra created a dry dog food recipe just for them. Made with natural sources of glucosamine and chondroitin, Ultra Large Breed Dog Food nourishes bones and joints for healthy mobility. The nutrient-rich, premium ingredients in this wholesome dog food, such as chicken, lamb and salmon protein, deliver complete and balanced nutrition in a great-tasting kibble. And, like all Ultra Adult Dog Foods, it is 100% all natural.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-large-breed-adult-dry-dog-food-15-lbs/10090320-Ultra-dry-dog-front.jpg'),
    (6, 'Nutro Ultra Large Breed Adult Dry Dog Food, 30 lbs', 29, 'food', 90, 'Large breed dogs have specific nutritional needs. That''s why Ultra created a dry dog food recipe just for them. Made with natural sources of glucosamine and chondroitin, Ultra Large Breed Dog Food nourishes bones and joints for healthy mobility. The nutrient-rich, premium ingredients in this wholesome dog food, such as chicken, lamb and salmon protein, deliver complete and balanced nutrition in a great-tasting kibble. And, like all Ultra Adult Dog Foods, it is 100% all natural.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-large-breed-adult-dry-dog-food-30-lbs/10090321_Ultra_dry_dog_main.jpg'),
    (7, 'Nutro Ultra Adult Weight Management Dry Dog Food, 15 lbs', 23, 'food', 80, 'Nutro Ultra Adult Weight Management Dry Dog Food is formulated to help overweight and less active dogs achieve or maintain a healthy weight. Our premium dog food is made with nature''s finest ingredients to provide complete and balanced adult nutrition in every bowl while promoting the development of a lean body and healthy joins. Your dog will enjoy the unforgettable taste of premium natural ingredients!', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-adult-weight-management-dry-dog-food-15-lbs/10162673-1-Nutro-Main_Image__Front_.jpg'),
    (8, 'Nutro Ultra Adult Weight Management Dry Dog Food, 30 lbs', 17, 'food', 90, 'Ultra Weight Management Dog Food helps overweight and less active dogs achieve and maintain a healthier weight. This premium natural diet dog food features a perfect combination of three lean proteins, sun-ripened fruits and vegetables, whole grains, and pure sunflower oil to help support vital functions and a healthy immune system. Ultra Dry Dog Food, made with wholesome, natural ingredients, provides complete nutrition to help your dog live long and thrive.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-adult-weight-management-dry-dog-food-30-lbs/10090326-NUT-DWMA-30LB-BAG-FRONT-3D.jpg'),
    (9, 'Nutro Ultra Senior Dry Dog Food, 15 lbs', 44, 'food', 80, 'Ultra Senior Dog Food, made with high-quality, natural ingredients, gives aging dogs the essential nutrients they need for a healthy and active lifestyle. Formulated with vitamins and minerals, such as glucosamine and beta carotene, this adult dog food nourishes your dog''s joints for healthy mobility. Best of all, this natural dog food for mature adult dogs provides complete and balanced nutrition in every bowl.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-senior-dry-dog-food-15-lbs/10090330-Ultra-dry-dog-front.jpg'),
    (10, 'Nutro Ultra Senior Dry Dog Food, 30 lbs', 27, 'food', 90, 'Ultra Senior Dog Food, made with high-quality, natural ingredients, gives aging dogs the essential nutrients they need for a healthy and active lifestyle. Formulated with vitamins and minerals, such as glucosamine and beta carotene, this adult dog food nourishes your dog''s joints for healthy mobility. Best of all, this natural dog food for mature adult dogs provides complete and balanced nutrition in every bowl.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-senior-dry-dog-food-30-lbs/10090331-Ultra-dry-dog-front.jpg'),
    (11, 'Nutro Ultra Toy Breed Adult Dry Dog Food, 4 lbs', 16, 'food', 26, 'Ultra Toy Breed Adult Dry Dog Food is formulated to meet their energy needs of small dogs weighing less than 25 pounds. Made with wholesome, natural ingredients, this premium dog food contains a blend of three lean proteins that help promote strong muscles. Plus, rich sources of omega fatty acids nourish their skin for a soft, radiant coat. Give your dog complete and balanced nutrition in a great-tasting formula with Ultra Dry Dog Food.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-toy-breed-adult-dry-dog-food-4-lbs/10097177-Ultra-dry-dog-front.jpg'),
    (12, 'Nutro Wholesome Essentials Healthy Weight Pasture-Fed Lamb & Rice Recipe Adult Dry Dog Food, 30 lbs', 30, 'food', 80, 'Nutro Adult Lite Weight Loss Diet Lamb and Rice Recipe can help adult dogs feel full and reduce their overall food intake, which can help with weight loss. This nutritionally complete, low-calorie formula is made with two primary ingredients: real Australian and New Zealand lamb and whole brown rice to help promote easier digestion. Omega-6 fatty acid (linoleic acid), zinc and B vitamins also support healthy skin and a soft, Shiny Coat.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-healthy-weight-pasture-fed-lamb+rice-recipe-adult-dry-dog-food-30-lbs/10122924_main.jpg'),
    (13, 'Nutro Wholesome Essentials Small Bites Pasture-Fed Lamb & Rice Recipe Adult Dry Dog Food, 30 lbs', 15, 'food', 80, 'Some adult dogs prefer smaller kibble for easier chewing. That’s why there''s Nutro Limited Ingredient Diet Small Bites Adult Dog Food. Using limited ingredients, such as premium Australian and New Zealand lamb and whole brown rice, this natural dog food formula helps reduce the likelihood of food sensitivity and digestive problems. Natural ingredients, such as linoleic acid, zinc, B vitamins and antioxidants, also help give your dog a healthy immune system and a soft, Shiny Coat. Best of all, Nutro Limited Ingredient Dry Dog Food is made without corn gluten, corn, wheat or soy protein. It’s a small bite with a big taste your dog will enjoy, guaranteed.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-small-bites-pasture-fed-lamb+rice-recipe-adult-dry-dog-food-30-lbs/10122928_main.jpg'),
    (14, 'Nutro Adult Small Bites Lamb and Rice Recipe Dog Food, 5 lbs', 33, 'food', 23, 'Some adult dogs prefer smaller kibble for easier chewing. That’s why there''s Nutro Limited Ingredient Diet Small Bites Adult Dog Food. Using limited ingredients, such as premium Australian and New Zealand lamb and whole brown rice, this natural dog food formula helps reduce the likelihood of food sensitivity and digestive problems. Natural ingredients, such as linoleic acid, zinc, B vitamins and antioxidants, also help give your dog a healthy immune system and a soft, Shiny Coat. Best of all, Nutro Limited Ingredient Dry Dog Food is made without corn gluten, corn, wheat or soy protein. It’s a small bite with a big taste your dog will enjoy, guaranteed.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-adult-small-bites-lamb-and-rice-recipe-dog-food-5-lbs/10122930_main.jpg'),
    (15, 'Nutro Wholesome Essentials Pasture-Fed Lamb & Rice Recipe Senior Dry Dog Food, 30 lbs', 12, 'food', 80, 'Made with real lamb as the first ingredient, Nutro Senior Lamb and Rice Recipe Dog Food is the great-tasting formula that is specially designed for senior dogs. This natural dog food recipe is made with a limited number of ingredients to help minimize the risk of aggravating food sensitivities while delivering antioxidants and omega-3 fatty acids, including ALA and DHA, to promote brain, joint and cellular health. Best of all, Nutro Food for Senior Dogs is made with no artificial flavors, colors or preservatives, so you can feel confident that your dog is getting only high-quality ingredients and nutrition in every bite.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-pasture-fed-lamb+rice-recipe-senior-dry-dog-food-30-lbs/10122932_main.jpg'),
    (16, 'Nutro Wholesome Essentials Pasture-Fed Lamb & Rice Recipe Adult Dry Dog Food, 30 lbs', 28, 'food', 80, 'Using fewer ingredients can help reduce the likelihood of digestive problems and food sensitivities. That’s why Nutro Adult Lamb and Rice Recipe Dog Food is made with two primary ingredients: real Australian and New Zealand lamb and whole brown rice. This natural adult dog food has added vitamins, minerals and natural antioxidants that are vital for a healthy metabolism. Plus, the premium, natural ingredients in Nutro Dry Dog Food can all be traced back to their sources. The result is optimal nutrition your dog needs, a taste they enjoy and the visible key benefits you want. We guarantee it or your money back.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-pasture-fed-lamb+rice-recipe-adult-dry-dog-food-30-lbs/10122937_main.jpg'),
    (17, 'Nutro Wholesome Essentials Pasture-Fed Lamb & Rice Recipe Adult Dry Dog Food, 5 lbs', 35, 'food', 23, 'Using fewer ingredients can help reduce the likelihood of digestive problems and food sensitivities. That’s why Nutro Adult Lamb and Rice Recipe Dog Food is made with two primary ingredients: real Australian and New Zealand lamb and whole brown rice. This natural adult dog food has added vitamins, minerals and natural antioxidants that are vital for a healthy metabolism. Plus, the premium, natural ingredients in Nutro Dry Dog Food can all be traced back to their sources. The result is optimal nutrition your dog needs, a taste they enjoy and the visible key benefits you want. We guarantee it or your money back.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-pasture-fed-lamb+rice-recipe-adult-dry-dog-food-5-lbs/10122939_main.jpg'),
    (18, 'Nutro Wholesome Essentials Pasture-Fed Lamb & Rice Recipe Large Breed Adult Dry Dog Food, 30 lbs', 22, 'food', 80, 'For adult large breed dogs that require a limited ingredient dog food, there''s great-tasting Nutro Large Breed Lamb and Whole Brown Rice Recipe Dog Food. Offering a premium taste your dog will enjoy, this Nutro Dry Dog Food formula provides the necessary vitamins, minerals and antioxidants for a healthy metabolism, plus naturally sourced glucosamine and chondroitin to help build healthy cartilage and joints. Each bite of this natural dog food is infused with optimal levels of omega-6 fatty acid (linoleic), zinc and B vitamins to guarantee a soft coat that shines. Best of all, Nutro Food for Dogs is made with no corn gluten meal, wheat or soy protein to reduce the likelihood of aggravating food sensitivities.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-pasture-fed-lamb+rice-recipe-large-breed-adult-dry-dog-food-30-lbs/10122945_main.jpg'),
    (19, 'Nutro Wholesome Essentials Pasture-Fed Lamb & Rice Recipe Large Breed Puppy Dry Dog Food, 30 lbs', 45, 'food', 80, 'Nutro Large Breed Puppy Lamb and Whole Brown Rice Formula Dog Food is the great-tasting, natural Puppy food that is specially prepared for dogs with sensitive systems. Made with grass-fed lamb as the first ingredient, Nutro Limited Ingredient Puppy Food contains an optimal blend of proteins, fats, vitamins and minerals for a healthy metabolism, as well as naturally sourced glucosamine and chondroitin to promote strong bones and healthy joints. Made with no artificial colors, flavors or preservatives, Nutro Large Breed Dog Food gives growing dogs the nutrients they need for healthy development.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-pasture-fed-lamb+rice-recipe-large-breed-puppy-dry-dog-food-30-lbs/10122947_main.jpg'),
    (20, 'Nutro Wholesome Essentials Farm-Raised Chicken, Brown Rice & Sweet Potato Recipe Large Breed Senior Dry Dog Food, 30 lbs', 42, 'food', 75, 'Because of their larger frames, large breed dogs need high-quality proteins, healthy nutrients, such as glucosamine and chondroitin, and balanced levels of calcium and phosphorus to ensure proper muscle maintenance and healthy joints and bones. To meet their needs, Nutro Large Breed Senior Dog Food is made with real, farm raised chicken, whole grains and balanced fiber. Nutro Natural Dog Food not only offers a taste your dog will enjoy, but it also promotes healthy digestion because the simple, natural ingredients help Maximize nutrient absorption. And because it’s packed with vitamins, minerals and amino acids, your dog gets the nutrition they deserve in every bite.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-farm-raised-chicken-brown-rice+sweet-potato-recipe-large-breed-senior-dry-dog-food-30-lbs/10122949_main.jpg'),
    (21, 'Nutro Wholesome Essentials Farm-Raised Chicken, Brown Rice & Sweet Potato Recipe Puppy Dry Dog Food, 15 lbs', 33, 'food', 45, 'Make sure your Puppy gets off to a healthy start with a natural Puppy food designed for growth and development. Nutro Puppy Chicken, Whole Brown Rice and Oatmeal Recipe Dog Food, made with real, farm-raised chicken as the first ingredient, contains the amino acids necessary for building muscle and maintaining a healthy metabolism. Nutro Puppy Food is made with oatmeal for sensitive stomachs, whole brown rice for better nutrient absorption and a precise balance of calcium and phosphorus to help build strong bones and teeth. Best of all, this premium Puppy food contains no artificial flavors, colors or preservatives, so you can feel confident knowing your pup is getting only high-quality ingredients and nutrition in every bite.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-farm-raised-chicken-brown-rice+sweet-potato-recipe-puppy-dry-dog-food-15-lbs/10122956_main.jpg'),
    (22, 'Nutro Wholesome Essentials Farm-Raised Chicken, Brown Rice & Sweet Potato Recipe Large Breed Puppy Dry Dog Food, 30 lbs', 44, 'food', 75, 'Whether it is developing strong and healthy joints or ensuring overall balanced growth, large breed puppies need proper nutrition to help keep them strong and active. That’s why Nutro Large Breed Puppy Food uses naturally sourced glucosamine and chondroitin to help them build healthy cartilage. With balanced protein and fat for optimal growth, this great tasting, natural Puppy food also features U.S. farm-raised chicken for strong muscles and a healthy metabolism. Plus, whole brown rice and oatmeal provide easy digestion for large breed puppies with sensitive stomachs. They will enjoy the taste, and you will love seeing them mature into the happy, healthy dogs they were meant to be.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-farm-raised-chicken-brown-rice+sweet-potato-recipe-large-breed-puppy-dry-dog-food-30-lbs/10123052_main.jpg'),
    (23, 'Nutro Wholesome Essentials Farm-Raised Chicken, Brown Rice & Sweet Potato Recipe Adult Dry Dog Food, 30 lbs', 11, 'food', 75, 'Dogs crave hearty, natural ingredients. Give your best buddy a savory meal they will look forward to every time with Nutro Adult Chicken, Whole Brown Rice and Oatmeal Recipe Dog Food. Made with real chicken as the first ingredient, this dry dog food delivers the amino acids adult dogs need to build muscle and maintain a healthy metabolism. Nutro Food for Dogs also uses whole grains to nourish a healthy digestive system for proper nutrient absorption, including whole oatmeal, which is high in soluble fiber for sensitive stomachs, and antioxidants, plus vitamin E, for a healthy immune system and overall cellular health.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-farm-raised-chicken-brown-rice+sweet-potato-recipe-adult-dry-dog-food-30-lbs/10123053_main.jpg'),
    (24, 'Nutro Wholesome Essentials Farm-Raised Chicken, Brown Rice & Sweet Potato Recipe Senior Dry Dog Food, 30 lbs', 25, 'food', 75, 'Older dogs can experience some of the same challenges as aging humans, including mobility issues, memory loss and sensitivity to certain foods. Nutro Senior Chicken, Whole Brown Rice and Oatmeal Recipe Dog Food with the Nutro Senior Support System Formula helps replenish antioxidants older dogs need as they age. Featuring omega-3 fatty acids, ALA and DHA for brain and cellular health, this premium senior dog food is also made with real chicken, whole brown rice and oatmeal, so it is delicious and easy to digest. Bet of all, the added benefit of naturally sourced glucosamine and chondroitin helps keep their joints strong and healthy.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-farm-raised-chicken-brown-rice+sweet-potato-recipe-senior-dry-dog-food-30-lbs/10123055_main.jpg'),
    (25, 'Nutro Wholesome Essentials Healthy Weight Farm-Raised Chicken, Rice & Sweet Potato Recipe Large Breed Adult Dry Dog Food, 30 lbs', 18, 'food', 75, 'Nutro Large Breed Adult Weight Management Dog Food helps large breed dogs that are prone to weight gain maintain their ideal body condition. This lite dog food recipe, made with real chicken as the first ingredient, features natural fibers and whole grains to help dogs feel full. Nutro Large Breed Adult Weight Management Dog Food Chicken, Whole Brown Rice & Oatmeal Dog Food also contains a unique blend of amino acids, vitamins, minerals and naturally sourced nutrients, such as glucosamine and chondroitin to nourish healthy joints. Best of all, this dog food for large breed dogs promotes healthy skin and a soft coat.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-healthy-weight-farm-raised-chicken-rice+sweet-potato-recipe-large-breed-adult-dry-dog-food-30-lbs/10123066_main.jpg'),
    (26, 'Nutro Wholesome Essentials Farm-Raised Chicken, Brown Rice & Sweet Potato Recipe Puppy Dry Dog Food, 5 lbs', 41, 'food', 21, 'Nutro Puppy Chicken, Whole Brown Rice and Oatmeal Recipe contains real, farm-raised chicken to provide the amino acids necessary for building muscle and maintaining a healthy metabolism. This natural food for puppies is also made with oatmeal for sensitive stomachs, whole brown rice for better nutrient absorption and a precise balance of calcium and phosphorus to help build strong bones and teeth.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-farm-raised-chicken-brown-rice+sweet-potato-recipe-puppy-dry-dog-food-5-lbs/10123067_main.jpg'),
    (27, 'Nutro Wholesome Essentials Healthy Weight Farm-Raised Chicken, Lentils & Sweet Potato Recipe Adult Dry Dog Food, 30 lbs', 37, 'food', 75, 'Nutro Adult Lite Weight Loss Chicken, Whole Brown Rice and Oatmeal Recipe Dog Food is the great-tasting formula that helps less active and overweight dogs achieve a healthy weight. The first ingredient in this nutritionally complete, low-calorie dog food is U.S.-farm-raised chicken. Nutro Natural Dog Food also features a mix of high fiber and protein to help dogs feel full, which can reduce their food intake to aid in weight loss.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-healthy-weight-farm-raised-chicken-lentils+sweet-potato-recipe-adult-dry-dog-food-30-lbs/10123088_main.jpg'),
    (28, 'Blue Buffalo Freedom Grain Free Chicken Recipe for Adult Indoor Cats, 11 lbs', 30, 'food', 45, 'STARTS WITH REAL CHICKEN: A recipe with delicious, real chicken as the first ingredient, this dry cat food features the high-quality ingredients you can feel good about feeding your feline friend without the grains that contain gluten. GRAIN FREE CAT FOOD: BLUE Freedom grain free indoor cat food is specially formulated to help meet the unique needs of indoor cats including natural fiber sources to promote healthy digestion and carefully balanced calories to help maintain healthy body weight. WITH LIFESOURCE BITS: This formula contains BLUE’s exclusive LifeSource Bits – a precise blend of antioxidants, vitamins and minerals carefully selected by holistic veterinarians and animal nutritionists to support immune system health, life stage requirements, and a healthy oxidative balance. NATURAL CAT FOOD: BLUE dry cat food is formulated for the health and well-being of your adult cat and features the finest natural ingredients enhanced with vitamins and minerals. It never contains chicken (or poultry) by-product meals, corn, wheat, soy, artificial flavors or preservatives. NATURAL CAT FOOD: BLUE dry cat food is formulated for the health and well-being of your adult cat and features the finest natural ingredients enhanced with vitamins and minerals. It never contains chicken (or poultry) by-product meals, corn, wheat, soy, artificial flavors or preservatives.', 'https://www.petproducts.com/static/upload/products/blue-buffalo-freedom-grain-free-chicken-recipe-for-adult-indoor-cats-11-lbs/859610007073-2.jpg'),
    (29, 'Vital Essentials Freeze-Dried Grain Free Beef Nibblets, 1 lb', 26, 'food', 30, 'Your dogs knows what that they want for dinner – real meat. Locally sourced from America’s heartland, Freeze-Dried grain-free Beef Nibblets are made with the perfect blend of fresh, wholesome beef, organs and bones, just as nature intended. Serve as a complete and balanced meal, a nutritious treat, or mixed in with kibble. Give your dog the benefits of a raw food diet with the convenience of this freeze-dried entree.', 'https://www.petproducts.com/static/upload/products/vital-essentials2/-vital-essentials-freeze-dried-grain-free-beef-nibblets-1-lb/033211008947_Vital%20Essentials_Freeze-Dried%20Nibblets_Beef_1%20lb_1.png'),
    (30, 'Stella & Chewy''s Chewy''s Chicken Dinner Patties Freeze-Dried Raw Dog Food, 14 oz', 42, 'food', 36, 'Give your dog what he naturally craves with Stella & Chewy''s Chewy''s Chicken Dinner Patties Freeze-Dried Raw Dog Food. Based on the philosophy that dogs thrive on the same diet they would eat in the wild, this all-natural recipe makes it easy to feed your best friend only the good stuff. Made from sustainably-sourced ingredients and raw, single-source protein, this recipe starts with 95% cage-free chicken, organs and bone, plus 100% certified-organic fruits and vegetables—offering the benefits of raw food nutrition with the convenience of freeze-dried preparation. And to ensure the highest quality, each batch is made with care in Stella & Chewy’s own U.S.-kitchen. Key Benefits Made with cage-free chicken raised without hormones or antibiotics and 100% organic-certified fruits and vegetables. Real raw nutrition in the convenience of freeze-dried patties; serve as is or rehydrate by adding water. Formulated to mimic a canine’s natural diet; never contains grains, gluten, fillers, artificial preservatives or colorings. Complete and balanced nutrition is enhanced with probiotics to aid in healthy digestion—perfect for the pup with a sensitive stomach. Proudly made in the USA with ingredients responsibly sourced from trusted and reputable suppliers. Precautions Stella & Chewy''s products must always remain raw when feeding. Please do not cook, heat, or microwave the products. If rehydrating, use cool or warm (never hot) water. Please note patty count per bag may vary slightly due to the product being filled by weight. 5.5-oz bag: approx. 11 patties. 14-oz bag: approx. 28 patties. 25-oz bag: approx. 50 patties.', 'https://www.petproducts.com/static/upload/products/stella+chewys/-stella+chewys-chewys-chicken-dinner-patties-freeze-dried-raw-dog-food-14-oz/186011000045.jpg'),
    (31, 'Stella & Chewy''s Chewy''s Chicken Dinner Patties Freeze-Dried Raw Dog Food, 5.5 oz', 14, 'food', 16, 'Give your dog what he naturally craves with Stella & Chewy''s Chewy''s Chicken Dinner Patties Freeze-Dried Raw Dog Food. Based on the philosophy that dogs thrive on the same diet they would eat in the wild, this all-natural recipe makes it easy to feed your best friend only the good stuff. Made from sustainably-sourced ingredients and raw, single-source protein, this recipe starts with 95% cage-free chicken, organs and bone, plus 100% certified-organic fruits and vegetables—offering the benefits of raw food nutrition with the convenience of freeze-dried preparation. And to ensure the highest quality, each batch is made with care in Stella & Chewy’s own U.S.-kitchen. Key Benefits Made with cage-free chicken raised without hormones or antibiotics and 100% organic-certified fruits and vegetables. Real raw nutrition in the convenience of freeze-dried patties; serve as is or rehydrate by adding water. Formulated to mimic a canine’s natural diet; never contains grains, gluten, fillers, artificial preservatives or colorings. Complete and balanced nutrition is enhanced with probiotics to aid in healthy digestion—perfect for the pup with a sensitive stomach. Proudly made in the USA with ingredients responsibly sourced from trusted and reputable suppliers. Precautions Stella & Chewy''s products must always remain raw when feeding. Please do not cook, heat, or microwave the products. If rehydrating, use cool or warm (never hot) water. Please note patty count per bag may vary slightly due to the product being filled by weight. 5.5-oz bag: approx. 11 patties. 14-oz bag: approx. 28 patties. 25-oz bag: approx. 50 patties.', 'https://www.petproducts.com/static/upload/products/stella+chewys/-stella+chewys-chewys-chicken-dinner-patties-freeze-dried-raw-dog-food-55-oz/186011000052.jpg'),
