    (72, 'Stella & Chewy''s Perfectly Puppy Beef & Salmon Dinner Patties Freeze-Dried Raw Dog Food, 5.5 oz', 40, 'food', 16, 'Help your puppy pal reach her optimal growth potential with Stella & Chewy''s Perfectly Puppy Beef & Salmon Dinner Patties Freeze-Dried Raw Dog Food. These dinner patties were crafted with the philosophy that our furry friends thrive on the same diet they would eat in the wild, which is why they are made with real grass-fed beef and wild-caught salmon! High in protein, this recipe is made from 95% meat, organs and bone that has been finely grounded, so your pal can safely get the nutrition she needs to support lean, healthy muscle growth. Best of all each freeze-dried raw patty contains probiotics to support digestion, antioxidants to support immunity and DHA to support you buddy’s brain development! Key Benefits Formulated with added vitamins and minerals, this recipe is made with 95% cage-free poultry, organs and safely grounded bone, to provide your puppy pal with the nutrients she needs. Grain-free, all-natural and minimally-processed puppy food contains zero added hormones, antibiotics, grains or fillers. Includes nutrient-rich superfoods including chia seed for healthy skin and coat and overall outstanding nutrition and New Zealand green mussels for superior joint support. A raw diet may help support healthy digestion, strong teeth and gums, vibrant skin and coat as well as stamina and vitality. Every small batch is proudly made with responsibly sourced ingredients in Stella & Chewy’s USA-based kitchen. Please note patty count per bag may vary slightly due to the product being filled by weight. 5.5-oz bag: approx. 38-42 patties. 14-oz bag: approx. 95-105 patties.', 'https://www.petproducts.com/static/upload/products/stella--chewys-perfectly-puppy-beef--salmon-dinner-patties-freeze-dried-raw-dog-food-55-oz/852301008083-2.jpg'),
