    (83, 'Stella & Chewy''s Dandy Lamb Dinner Patties Freeze-Dried Raw Dog Food, 25 oz', 45, 'food', 60, 'Give your dog what he naturally craves with Stella & Chewy''s Dandy Lamb Dinner Patties Freeze-Dried Raw Dog Food. Based on the philosophy that dogs thrive on the same diet they would eat in the wild, this all-natural recipe makes it easy to feed your best friend only the good stuff. Made from sustainably-sourced ingredients and raw, single-source protein, this recipe starts with 95% grass-fed lamb, organs and bone, plus 100% certified organic fruits and vegetables—offering the benefits of raw food nutrition with the convenience of freeze-dried preparation. And to ensure the highest quality, each batch is made with care in Stella & Chewy’s own U.S. kitchen. Key Benefits Made with grass-fed lamb raised without hormones or antibiotics and 100% organic-certified fruits and vegetables. Real raw nutrition in the convenience of freeze-dried patties; serve as is or rehydrate by adding water. Formulated to mimic a canine’s natural diet; never contains grains, gluten, fillers, artificial preservatives or colorings. Complete and balanced nutrition is enhanced with probiotics to aid in healthy digestion—perfect for the pup with a sensitive stomach. Proudly made in the USA with ingredients responsibly sourced from trusted and reputable suppliers. Precautions Stella & Chewy''s products must always remain raw when feeding. Please do not cook, heat, or microwave the products. If rehydrating, use cool or warm (never hot) water. Please note patty count per bag may vary slightly due to the product being filled by weight. 5.5-oz bag: approx. 11 patties. 14-oz bag: approx. 28 patties. 25-oz bag: approx. 50 patties.', 'https://www.petproducts.com/static/upload/products/stella+chewys/-stella+chewys-dandy-lamb-dinner-patties-freeze-dried-raw-dog-food-25-oz/186011001837.jpg'),
    (84, 'Stella & Chewy''s Freeze-Dried Raw Lil'' Bites Itty Bitty Beef Recipe Small Breed Dog Food, 7 oz', 27, 'food', 23, 'Treat your dog to the raw nutrition of Lil’ Bites Freeze-Dried Raw Dog Food. Stella & Chewy’s raw freeze-dried meals are uncooked and minimally processed to help preserve naturally occurring nutrients. Feeding your pet a raw diet may help support healthy digestion, skin, coat, teeth, gums and energy levels. This tail-wagging Itty Bitty Beef recipe contains 95% grass-fed beef, organs and bone, along with certified organic fruits and vegetables, including cranberries, spinach, broccoli, beets, carrots, squash and blueberries. It’s made without grains, gluten, corn, wheat or soy for sensitive pups and it''s high in protein to provide small and extra small sidekicks with the energy they need to fuel their day. You can feel good knowing that your little one is getting the big nutrition she deserves when you pour her a bowl of Stella & Chewy’s Lil’ Bites! Key Benefits Crafted with certified organic fruits and vegetables and 95% grass-fed beef, organs and bone that have been safely ground for easy digestion. Superfoods including chia seed and coconut flour help encourage healthy skin and a shiny, lustrous coat. Minimally processed grain-free and gluten-free recipe made without added hormones, antibiotics or fillers. Raw, freeze-dried food may help support strong teeth and gums, promote healthy digestion and energy levels. Made in the USA with responsibly-sourced ingredients for small breed dogs.', 'https://www.petproducts.com/static/upload/products/stella+chewys/-stella+chewys-freeze-dried-raw-lil-bites-itty-bitty-beef-recipe-small-breed-dog-food-7-oz/852301008366.jpg'),
