    (123, 'Stella & Chewy''s Absolutely Rabbit Dinner Morsels Freeze-Dried Raw Cat Food, 3.5 oz', 39, 'food', 14, 'Satisfy your kitty’s craving for real meat with Stella & Chewy''s Absolutely Rabbit Dinner Morsels Freeze-Dried Raw Cat Food! Fresh, farm-raised rabbit is the main ingredient used in this raw, antibiotic free dish. This feline favorite delivers unparalleled high protein to your best pal’s bowl without adding grains or preservatives that cats can’t digest. Plus, Stella & Chewy’s is all-natural and minimally processed with limited ingredient diets and added taurine to promote silky soft fur and healthy skin. Cut the unnecessary carbohydrates and give your kitty what they crave! Key Benefits Each small batch recipe is crafted with care in Stella & Chewy’s own kitchen without the use of ingredients from China. No need to rehydrate—simply scoop, mix and serve with the included scooper. All natural and holistic recipe is free of common allergens such as grain, gluten, fillers, and artificial preservatives or colors. Natural oils and minimally processed food can help relieve itchy skin and hot spots. Made for cats of all ages—even picky cats enjoy the tasty meaty flavor of Stella & Chewy’s.', 'https://www.petproducts.com/static/upload/products/stella+chewys/-stella+chewys-absolutely-rabbit-dinner-morsels-freeze-dried-raw-cat-food-35-oz/186011001165.jpg'),
    (124, 'Stella & Chewy''s Yummy Lickin'' Salmon & Chicken Dinner Morsels Freeze-Dried Raw Cat Food, 18 oz', 22, 'food', 47, 'Give your kitty what she naturally craves with Stella & Chewy''s Yummy Lickin'' Salmon & Chicken Dinner Morsels Freeze-Dried Raw Cat Food. Based on the philosophy that cats thrive on the same diet they would eat in the wild, this all-natural recipe makes it easy to feed your favorite feline only the good stuff. Made from sustainably-sourced ingredients and raw, single-source protein, this recipe starts with 98% wild-caught salmon and farm-raised chicken, including organs and bone, along with wholesome pumpkin seeds—offering the benefits of raw food nutrition with the convenience of freeze-dried preparation. And to ensure the highest quality, each batch is made with care in Stella & Chewy’s own U.S. kitchen. Key Benefits Made with wild-caught salmon and ground bone, along with farm-raised chicken raised without antibiotics or hormones, including organs and ground bone. Real raw nutrition in the convenience of freeze-dried nuggets; serve as is or rehydrate by adding water. Formulated to mimic a feline’s natural diet; never contains grains, glutens, fillers, artificial preservatives or colorings. Complete and balanced nutrition is enhanced with probiotics to aid in healthy digestion—perfect for the cat with a sensitive stomach. Proudly made in the USA with ingredients responsibly sourced from trusted and reputable suppliers. Precautions Stella & Chewy''s products must always remain raw when feeding. Please do not cook, heat, or microwave the products. If rehydrating, use cool or warm (never hot) water.', 'https://www.petproducts.com/static/upload/products/stella+chewys/-stella+chewys-yummy-lickin-salmon+chicken-dinner-morsels-freeze-dried-raw-cat-food-18-oz/186011001271.jpg'),
