    (127, 'Nulo Freestyle Grain Free Chicken & Cod Recipe Dry Cat & Kitten Food, 5 lbs', 17, 'food', 23, 'Our feline friends require nutrition that helps maintain lean muscles without excess calories. That’s why this grain-free chicken & cod recipe is formulated with 83% animal-based proteins and low glycemic index ingredients, making it perfect for growing kittens to adult cats. Key Benefits Grain-free formula is ideal for cats and kittens. Specially made disk-shaped kibble feature a texture and taste that cats love. Also formulated free from potatoes or tapioca. The first four ingredients are deboned chicken, chicken meal, turkey meal and deboned cod. Nulo’s special poultry and fish blend provides plenty of the protein cats and kittens need to grow and maintain lean muscle mass. Made with only the finest ingredients around, this product is forged with 83% animal-based proteins. A balanced amount of Omega-3 and Omega-6 fatty acids nourish your cat’s skin and help promote a beautiful shiny coat. Made to provide a number of benefits for numerous diet requirements. Nulo is powered by a pure probiotic strain that supports gastrointestinal health. Also an ideal diet for cats who need a low carbohydrate and glycemic food regimen. Dried chicory root, dried kelp and the antioxidants Vitamin C & Vitamin E promote overall health. Vitamin A and Taurine support vision and healthy heart function', 'https://www.petproducts.com/static/upload/products/nulo/-nulo-freestyle-grain-free-chicken+cod-recipe-dry-cat+kitten-food-5-lbs/811939020157.jpeg'),
