    (133, 'Grandma Lucy''s Artisan Freeze Dried Grain Free Cat Food - Chicken & Fish Recipe, 1 lb (0.45kg)', 40, 'food', 11, 'Crafted with the belief that your favorite feline deserves the same great quality of food as you, Grandma Lucy''s Artisan Grain-Free Chicken & Fish Freeze-Dried Cat Food is made using the highest quality ingredients from trusted restaurant suppliers. Every single ingredient is chosen with a specific benefit in mind, inspected for quality and prepared in small batches at their family-owned California facility. From anti-inflammatory properties to maintaining a healthy digestive system and heart, it’s the easy way for your furry friend to eat her way to better health. This all-natural, grain-free recipe is an ideal choice for the kitty with food allergies or sensitivities.', 'https://www.petproducts.com/static/upload/products/grandma-lucys/-grandma-lucys-artisan-freeze-dried-grain-free-cat-food-chicken+fish-recipe-1-lb-045kg/1lb_artisan_cat.png'),
    (134, 'Grandma Lucy''s Simple Replacement Meal, Chicken & Rice Formula, 7 oz (198g)', 37, 'food', 13, 'Now a simple remedy for your dog or cat when they are suffering from an upset stomach – Grandma Lucy’s Simple Remedy! To give your pet an easy to digest meal until they are feeling back to normal, just add hot/boiling water to the chicken and rice mixture and feed your pet small amounts until their ailment disappears. As recommended by veterinarians, Grandma Lucy’s Simple Remedy is human-grade, white, boneless, skinless chicken breasts and plain white rice – nothing else. Finally a convenient way to make your pet’s stomach feel back to normal, just like the doctor ordered.', 'https://www.petproducts.com/static/upload/products/grandma-lucys/-grandma-lucys-simple-replacement-meal-chicken+rice-formula-7-oz-198g/Simple_Remedy.png'),
