    (139, 'Caru Pet Food Classic Chicken Stew Grain-Free Wet Cat Food, 6 oz', 47, 'food', 3, 'If you have a cat whos super-picky or simply hungry for a home-cooked meal, have we got a Stew for you. Just like our canine recipes, Caru Classic stews for cats are slow cooked in small batches to look, smell and taste like homemade. Crafted to nourish both cats and kittens, These human grade, GMO, grain and gluten free recipes are sure to bowl your pet over when they get a taste of these just like home Made meals.', 'https://www.petproducts.com/static/upload/products/assorted/caru-pet-food--classic-chicken-stew-grain-free-wet-cat-food-6-oz/53hswve.jpg'),
