    (144, 'Iams Proactive Health Kitten Chicken Recipe Dry Cat Food, 7 lb', 18, 'food', 19, 'Give your kitten the same wholesome nutrition as mother''s milk with IAMS PROACTIVE HEALTH Kitten (1 Year Old and Younger) Chicken Recipe Dry Cat Food. This wholesome cat food formula -- designed specifically for growing kittens -- is made with chicken as the first ingredient and contains 0% fillers. IAMS Food for Kittens also features omega-3 DHA for brain development, taurine for vision and eye health and antioxidants to support a healthy immune system. Best of all, our tailored fiber blend with prebiotics and beet pulp supports healthy digestion and helps maximize nutrient absorption, so you know your little one''s favorite hearty cat food is helping them grow into happy, healthy adult cats. Help your kitten grow big and strong with IAMS PROACTIVE HEALTH Kitten Formula Dry Food for Cats.', 'https://www.petproducts.com/static/upload/products/assorted/iams--proactive-health-kitten-chicken-recipe-dry-cat-food-7-lb/ffhhwrg.jpg'),
    (145, 'Iams Proactive Health Lively Senior 11+ Chicken Recipe Dry Cat Food, 7 lb', 42, 'food', 19, 'Give your senior cat the nutrition they need in a hearty cat food to live long and stay strong. IAMS PROACTIVE HEALTH Lively Senior (11 Years Old and Older) Chicken Recipe Dry Cat Food is made with chicken as the first ingredient and contains 0% fillers. Pet parents choose IAMS Food for Senior Cats, because it is formulated to nourish bones and joints, while L-carnitine helps senior cats maintain an ideal body condition. This wholesome cat food also is enriched with antioxidants to support a healthy immune system and contains a tailored fiber blend, with healthy prebiotics and beet pulp, to support digestion and nutrient absorption. Help your older cat feel their best at any age with IAMS PROACTIVE HEALTH Senior Plus Formula Dry Food for Cats.', 'https://www.petproducts.com/static/upload/products/assorted/iams--proactive-health-lively-senior-11+-chicken-recipe-dry-cat-food-7-lb/p8kc9xf.jpg'),
    (146, 'Iams Proactive Health Adult Urinary Tract Healthy With Chicken Cat Kibble Dry Cat Food, 16 lb', 20, 'food', 34, 'IAMS knows that each cat is different. That''s why our range of recipes has been specifically tailored to your cat''s needs and life stages. Keep your cats at their best with IAMS PROACTIVE HEALTH Adult Urinary Tract Health Dry Cat Food with Chicken. Perfect for outdoor or indoor cats, this formula helps reduce the pH in cat urine to promote urinary tract health. Chicken is the #1 ingredient in this protein-rich cat kibble formula. Plus, it includes vitamin E to maintain a healthy feline immune system, as well as essential nutrients, like calcium and potassium, for a healthy heart. The kibble has an optimal omega-6 and -3 fatty acid ratio for a soft, shiny coat, and the crunchy texture helps reduce plaque buildup. So, if you''re looking for a dry food for urinary tract health, get your paws on this… and keep your feline happy, healthy, and ready to pounce with IAMS.', 'https://www.petproducts.com/static/upload/products/assorted/iams--proactive-health-adult-urinary-tract-healthy-with-chicken-cat-kibble-dry-cat-food-16-lb/5rtl7nk.jpg'),
