    (158, 'Instinct Raw Boost Mixers Grain Free Skim & Coat Health Freeze Dried Raw Cat Food Topper, 5.5 oz', 46, 'food', 16, 'Top your cat''s kibble with raw. Instinct Raw Boost Mixers Skin & Coat Health provides natural Omega 3 & 6 fatty acids to help maintain a healthy skin and coat. Our recipes combine cage-free chicken plus vibrant, functional, whole-food ingredients - 100% freeze-dried and bursting with flavor and nutrition. Top your kibble with freeze-dried raw for natural fatty acids - Omega 3 & 6 - to help maintain a healthy skin & coat - Made with cage-free chicken plus vibrant, functional whole-food ingredients like wild-caught cod, salmon oil, chia seeds and cranberries - Raw, whole-food ingredients are freeze-dried to gently remove the moisture, while locking in nutrients and flavor - Made without - grain, corn, wheat, soy, potato, artificial flavors or preservatives - Made in the USA with the finest ingredients from around the world', 'https://www.petproducts.com/static/upload/products/assorted/instinct--raw-boost-mixers-grain-free-skim+coat-health-freeze-dried-raw-cat-food-topper-55-oz/i1u4f12.jpg'),
