    (182, 'Instinct Grain-Free Lamb Formula Canned Cat Food, 3 oz, Case of 24', 28, 'food', 48, 'Giving your cat a nutritious diet is easy with Instinct Grain-Free Lamb Formula Canned Cat Food. Made with a high quality protein, omega fatty acids to support toned muscles and a glossy coat and skin, and essential and balanced vitamins to help them lead a happy life. The recipe is formulated with 95% real lamb, pork liver, and turkey so your cat will go crazy for the naturally delicious flavor in Instinct Grain-Free Lamb Formula Canned Cat Food. You''ll love knowing that your cat is getting real meat, and hearty fruits and vegetables in every bite of their food. Why We Love It 95% real lamb, pork liver, and turkey Grain-free and gluten-free Omega fatty acids for a healthy skin & coat', 'https://www.petproducts.com/static/upload/products/assorted/instinct--grain-free-lamb-formula-canned-cat-food-3-oz-case-of-24/zq5fnx4.jpg'),
