    (185, 'Meow Mix Tender Favorites Real Chicken And Beef In Gravy Cat Food Cups - 2.75 oz, Case of 12', 35, 'food', 13, 'Now known as Meow Mix Tender Favorites, this terrific cat food is still great-tasting and jam-packed with the nutrition that your cat has always pounced upon. Meow Mix Tender Favorites Real Chicken and Beef in Gravy Cat Food Cup is just one of the many lip-smacking flavors that will have your cat dashing into the kitchen the second you open the can! Made with juicy, shredded pieces of chicken and beef then mixed into a savory gravy, Meow Mix Tender Favorites Real Chicken and Beef in Gravy Cat Food Cup is an exceptional meal that your kitty will enjoy again and again! At Meow Mix, we are solely focused on the happiness of cats. We know cats are part of the family. That''s why our products are developed to satisfy your cat''s taste buds, while giving you the comfort of knowing that he will be happy and healthy.', 'https://www.petproducts.com/static/upload/products/assorted/meow-mix--tender-favorites-real-chicken-and-beef-in-gravy-cat-food-cups-275-oz-case-of-12/sndwfrh.jpg'),
