    (199, 'Merrick Purrfect Bistro Grain Free Real Chicken & Sweet Potato Recipe Dry Cat Food, 4 lb', 36, 'food', 20, 'Purrfect Bistro Real Chicken Recipe is a grain free diet high in quality protein with moderate fat levels and low levels of carbohydrates - the kind of diet cats thrive on. Our formula is fortified with vitamins, minerals, probiotics, and antioxidants and is, ideal for adult cats looking for a recipe to support overall health. Why We Love It Real deboned chicken is always the first ingredient. This high quality protein along with chicken and turkey meals, give this recipe a 70% protein level of meat sourced ingredients, making it highly digestible. Rich in Omega fatty acids to support healthy skin and fur, as well as added fiber for hairball control. Fresh produce, like sweet potatoes and peas, provide easily digestible carbohydrates to support sustained energy without upsetting sensitive digestive systems. All Merrick recipes are crafted in our Hereford, TX kitchen and cooked in the USA, in facilities that uphold strict FDA guidelines.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--purrfect-bistro-grain-free-real-chicken+sweet-potato-recipe-dry-cat-food-4-lb/x7280y8.jpg'),
