    (231, 'Spot Skinneeez Plush Raccoon Dog Toy - Mini', 44, 'toy', 8, 'Bring out your dogs natural hunting instinct. Dogs will enjoy hours of entertainment flip flopping our stuffing free skinneez toys. All Skinneez toys have 2 squeakers. 1 in the head and 1 in the tail for double the fun.', 'https://www.petproducts.com/static/upload/products/assorted/spot--skinneeez-plush-raccoon-dog-toy-20-long-/nhtmz52.jpg'),
