    (238, 'Chuckit! Classic Ball Launcher - 26 in', 22, 'toy', 21, 'The Chuckit, designed for hands-free pickup without bending over, is made to exercise your dog and not wear out your arm.', 'https://www.petproducts.com/static/upload/products/assorted/chuckit--classic-ball-launcher-26-in/clo38vu.jpg'),
    (239, 'Chuckit! Indoor Ball, 5.75"', 20, 'toy', 12, 'The Chuckit!® Indoor Ball is the perfect complement to wet or cold days, hardwood floors or late-night games of fetch inside. Made from textured chenille fabric that is ideal for small dogs and puppies. The soft construction is safe for indoor use and Features Bounceflex Core technology for a lightweight design which makes it soft enough when meeting a wall or furniture while still giving it just the right amount of bounce for indoor playtime. The multilayer construction provides added durability for long-lasting use. Use with the Chuckit! Indoor Launcher (not included) for no-slobber, hands-free pickup.', 'https://www.petproducts.com/static/upload/products/assorted/chuckit--indoor-ball-575/nsctz6p.jpg'),
    (240, 'Chuckit! Max Glow Ball, X-Large - 3.5"', 17, 'toy', 11, 'Now the fetch games don''t have to stop when the sun goes down! Introducing the new Glow Ball, for night-time play. Simply charge the Glow Ball by holding it up to a light source, resulting in a brilliant green glow. Compatible with Chuckit Ball Launcher.', 'https://www.petproducts.com/static/upload/products/assorted/chuckit--max-glow-ball-x-large-35/3foilvh.jpg'),
    (241, 'Chuckit Paraflight - Large - 9.5" Diameter (1 Pack)', 38, 'toy', 16, 'ChuckIt Paraflight Dog Toy is perfect for games of fetch, whether you''re out in the yard or in water! The paraflight features a soft rubber edge thats gentle on your dogs gums and teeth, but a strong nylon interior that makes it plenty durable for playtime.', 'https://www.petproducts.com/static/upload/products/assorted/chuckit-chuckit-paraflight-large-95-diameter-1-pack-/5nhy1od.jpg'),
    (242, 'Chuckit! Pocket Ball Launcher', 19, 'toy', 9, 'The Chuckit Pocket is compact, portable, designed for hands-free pick up, and its size enables you to take fetch games anywhere. Use with Chuckit compatible balls or standard size tennis balls.', 'https://www.petproducts.com/static/upload/products/assorted/chuckit--pocket-ball-launcher/9lsv851.jpg'),
    (243, 'Chuckit! The Whistler Chuck-It Ball, Medium, 2.5" Diameter - 2 pk', 13, 'toy', 9, 'Ready, set, fetch! The Chuckit!® Whistler® keeps the game of fetch interesting and challenging for your dog. Four holes in this high-bouncing rubber ball produce a whistle as it soars through the air to keep your dog interested and focused. Gripable rubber ball is made just the right size to use with your Chuckit! Launcher.', 'https://www.petproducts.com/static/upload/products/assorted/chuckit--the-whistler-chuck-it-ball-medium-25-diameter-2-pk/c1fkdwb.jpg'),
    (244, 'Chuckit! Ultra Ball, X-Large, 3.5"', 21, 'toy', 12, 'Designed for the most demanding use, this is no ordinary ball. Simply put, this is the best ball for the game of fetch. Has a high bounce, floats, very visible and durable, this ball is also compatible with the Chuckit Ball Launchers.', 'https://www.petproducts.com/static/upload/products/assorted/chuckit--ultra-ball--x-large-35/n4xpifk.jpg'),
    (245, 'Fat Cat Suspicious Chicken Flobbability Barnyard Bullies - (14" Long x 5.5" Wide)', 19, 'toy', 8, 'Maximum Floppability gives every dog somethin to cluck about! Barnyard Bullies Suspicious Chicken is for your dog! It has great floppy parts that whack your dog''s head when shaken about. Made of heavy-duty canvas, and contains a squeaker for more added fun!', 'https://www.petproducts.com/static/upload/products/assorted/fat-cat--suspicious-chicken-flobbability-barnyard-bullies-14-long-x-55-wide-/psv5cwq.jpg'),
    (246, 'KONG Squeakers Tennis Ball with Rope-2.5" diameter tennis ball; 15" long rope', 28, 'toy', 4, 'How do you make an Air KONG squeaker ball even better? Add a strong nylon throw rope so you can really get it going! These are real tennis ball toys, in an ultra-fetchable shape that''s great for play on land or in the water. Heavy duty toys will stand up to plenty of vigorous, supervised play.', 'https://www.petproducts.com/static/upload/products/assorted/kong--squeakers-tennis-ball-with-rope-25-diameter-tennis-ball-15-long-rope-/pwnfzau.jpg'),
